import React from 'react'
import QuoteList from '../components/quotes/QuoteList'

const DUMMY_QUOTES = [
  {id: 1, author: 'Dabsia', text: 'Work hard and believe its going to pay offf'},
  {id: 2, author: 'Dabo', text: 'Learning React is fun'}
]


const AllQuotes = () => {
  return (
    <QuoteList quotes = {DUMMY_QUOTES} />
  )
}

export default AllQuotes
